import App from './App'

function Social(){
    return(
        <ul>
            <input type="checkbox" id="facebbok" name="subscribe" value="newsletter" />
    <label for="subscribeNews">facebook</label><br/>
    <input type="checkbox" id="twitter" name="subscribe" value="newsletter" />
    <label for="subscribeNews">twitter</label>
    <input type="checkbox" id="youtube" name="subscribe" value="newsletter" />
    <label for="subscribeNews">youtube</label>       
        </ul>
    );
}
export default Social ;
